// --- Globals ---
struct termios g_orig_termios;
volatile int g_need_resize = 1;
int g_term_w = 0;
int g_term_h = 0;

// --- Terminal Control ---

void disable_raw_mode() {
    printf("%s", MOUSE_DISABLE);
    printf("%s", SHOW_CURSOR);
    printf("%s\n", RESET_COLOR);
    tcsetattr(STDIN_FILENO, TCSAFLUSH, &g_orig_termios);
}

void enable_raw_mode() {
    tcgetattr(STDIN_FILENO, &g_orig_termios);
    atexit(disable_raw_mode);

    struct termios raw = g_orig_termios;
    raw.c_lflag &= ~(ECHO | ICANON | ISIG);
    raw.c_cc[VMIN] = 0;
    raw.c_cc[VTIME] = 1;

    tcsetattr(STDIN_FILENO, TCSAFLUSH, &raw);
    printf("%s", MOUSE_ENABLE);
    printf("%s", HIDE_CURSOR);
    fflush(stdout);
}

void update_terminal_size() {
    struct winsize ws;
    if (ioctl(STDOUT_FILENO, TIOCGWINSZ, &ws) == -1 || ws.ws_col == 0) {
        g_term_w = 80;
        g_term_h = 24;
    } else {
        g_term_w = ws.ws_col;
        g_term_h = ws.ws_row;
    }
}

void sigwinch_handler(int sig) {
    (void)sig;
    g_need_resize = 1;
}

// --- Render Logic ---

void render() {
    if (g_term_w <= 0 || g_term_h <= 0) return;

    // Buffer to hold the entire frame string
    // W * H * (approx 20 bytes for ANSI color + 2 spaces) + padding
    size_t buf_cap = g_term_w * g_term_h * 32 + 4096;
    char *out_buf = malloc(buf_cap);
    if (!out_buf) return;
    
    char *ptr = out_buf;
    
    // Clear screen
    ptr += sprintf(ptr, "%s", CLEAR_SCREEN);

    int term_px_w = g_term_w / 2; // 2 chars per pixel
    int term_px_h = g_term_h;

    // Calculate Scale
    float scale_x = (float)IMG_W / term_px_w;
    float scale_y = (float)IMG_H / term_px_h;
    float scale = (scale_x > scale_y) ? scale_x : scale_y;
    
    // Calculate drawn dimensions
    int draw_w = (int)(IMG_W / scale);
    int draw_h = (int)(IMG_H / scale);
    
    // Clamp
    if (draw_w > term_px_w) draw_w = term_px_w;
    if (draw_h > term_px_h) draw_h = term_px_h;

    // Center offsets
    int offset_x = (term_px_w - draw_w) / 2;
    int offset_y = (term_px_h - draw_h) / 2;

    int current_r = -1, current_g = -1, current_b = -1;

    for (int y = 0; y < g_term_h; y++) {
        for (int x = 0; x < term_px_w; x++) {
            if (y >= offset_y && y < offset_y + draw_h && 
                x >= offset_x && x < offset_x + draw_w) {

                // Map screen -> image
                int img_x = (int)((x - offset_x) * scale);
                int img_y = (int)((y - offset_y) * scale);

                if (img_x < 0) img_x = 0;
                if (img_x >= IMG_W) img_x = IMG_W - 1;
                if (img_y < 0) img_y = 0;
                if (img_y >= IMG_H) img_y = IMG_H - 1;

                const uint8_t *p = &IMG_DATA[(img_y * IMG_W + img_x) * 3];
                uint8_t r = p[0];
                uint8_t g = p[1];
                uint8_t b = p[2];

                // ANSI Color Optimization
                if (r != current_r || g != current_g || b != current_b) {
                    ptr += sprintf(ptr, "\x1b[48;2;%d;%d;%dm", r, g, b);
                    current_r = r; current_g = g; current_b = b;
                }
                *ptr++ = ' '; *ptr++ = ' ';

            } else {
                // Background (Black/Default)
                if (current_r != -1) {
                    ptr += sprintf(ptr, "%s", RESET_COLOR);
                    current_r = -1; current_g = -1; current_b = -1;
                }
                *ptr++ = ' '; *ptr++ = ' ';
            }
        }
        // Newline at end of row
        ptr += sprintf(ptr, "%s\n", RESET_COLOR);
        current_r = -1; current_g = -1; current_b = -1;
    }
    
    // Status Bar
    ptr += sprintf(ptr, "\x1b[7m [Lain] %dx%d (Embedded) | Scale: %.2f | Q: Quit \x1b[0m", 
                   IMG_W, IMG_H, scale);

    write(STDOUT_FILENO, out_buf, ptr - out_buf);
    free(out_buf);
}

int main() {
    enable_raw_mode();
    signal(SIGWINCH, sigwinch_handler);
    update_terminal_size();
    render();

    char ibuf[64];
    while (1) {
        if (g_need_resize) {
            g_need_resize = 0;
            update_terminal_size();
            render();
        }

        int n = read(STDIN_FILENO, ibuf, sizeof(ibuf) - 1);
        if (n > 0) {
            ibuf[n] = '\0';
            // Q or Ctrl-C
            if (ibuf[0] == 'q' || ibuf[0] == 'Q' || ibuf[0] == 3) break;

            // Mouse events
            if (ibuf[0] == '\x1b' && ibuf[1] == '[' && ibuf[2] == '<') {
                int btn, tx, ty;
                char type;
                if (sscanf(ibuf + 3, "%d;%d;%d%c", &btn, &tx, &ty, &type) == 4) {
                    if (type == 'M') { // Mouse Press
                        // Recalculate layout to check hit
                        int term_px_w = g_term_w / 2;
                        int term_px_h = g_term_h;

                        float scale_x = (float)IMG_W / term_px_w;
                        float scale_y = (float)IMG_H / term_px_h;
                        float scale = (scale_x > scale_y) ? scale_x : scale_y;

                        int draw_w = (int)(IMG_W / scale);
                        int draw_h = (int)(IMG_H / scale);
                        
                        if (draw_w > term_px_w) draw_w = term_px_w;
                        if (draw_h > term_px_h) draw_h = term_px_h;

                        int offset_x = (term_px_w - draw_w) / 2;
                        int offset_y = (term_px_h - draw_h) / 2;

                        // Map Terminal Char Coords (1-based) to Internal Layout
                        int click_y = ty - 1;
                        int click_x = (tx - 1) / 2;

                        // Check Collision with Image Boundaries
                        if (click_y >= offset_y && click_y < offset_y + draw_h &&
                            click_x >= offset_x && click_x < offset_x + draw_w) {
                            
                            // Calculate Relative Coordinates (0.0 - 1.0) inside the image
                            float rel_x = (float)(click_x - offset_x) / draw_w;
                            float rel_y = (float)(click_y - offset_y) / draw_h;

                            // --- ROI Detection (Lain's Hit Box) ---
                            // Character occupies roughly the center area. 
                            // Excluding edges (background).
                            float roi_x_min = 0.15f;
                            float roi_x_max = 0.85f;
                            float roi_y_min = 0.10f;
                            float roi_y_max = 0.90f;

                            if (rel_x >= roi_x_min && rel_x <= roi_x_max &&
                                rel_y >= roi_y_min && rel_y <= roi_y_max) {
                                
                                // HIT! Lain Detected.
                                disable_raw_mode();
                                system("./experiments/ansi_renderer/lain_view_blue");
                                enable_raw_mode();
                                
                                tcflush(STDIN_FILENO, TCIFLUSH);
                                render();
                            } else {
                                // Clicked on image, but missed the character (Background hit)
                                char msg[64];
                                int len = snprintf(msg, sizeof(msg), "\033[1;1H\033[44m MISS (Background): %.2f, %.2f \033[0m", rel_x, rel_y);
                                write(STDOUT_FILENO, msg, len);
                            }
                        } else {
                            // Debug Info for missed clicks (Outside image)
                            char msg[64];
                            int len = snprintf(msg, sizeof(msg), "\033[1;1H\033[41m CLICK: %d,%d (Outside) \033[0m", tx, ty);
                            write(STDOUT_FILENO, msg, len);
                        }
                    }
                }
            }
        }
        usleep(10000);
    }
    return 0;
}
